        new( "AllPlanetOrderedByStrength(Timetime)"," Returns an array of all planets sorted by strenght 0 index being strongest to 8 index being weakest Note Significance of being Powerful.Among the several planets associated with a bhava that which has the greatest Sbadbala influences the bhava most. ","{ 'AllPlanetOrderedByStrength': 'Mercury, Sun, Jupiter, Moon, Saturn, Ketu, Venus, Rahu, Mars'}"),
        new( "IsPlanetBeneficInShadbala(PlanetNameplanet,Timetime)"," Significance of being Powerful.Among the several planets associated with a bhava that which has the greatest Sbadbala influences the bhava most. Powerful Planets.Ravi is befd to be powerful when hiShadbala Pinda is 5 or more rupas. Chandra becomes strong when his Shadbala Pinda is 6 or more rupas. Kuja becomes powerful when bis Shadbala Pinda does not fall short of 5 rupas.Budha becomes potent by having his Sbadbala Pinda as 7 rupas Guru Sukra and Sani become thoroughly powerful if their Shadbala Pindas are 6.5 5.5 and 5 rupas or more respectively. ","{ 'IsPlanetBeneficInShadbala': 'True'}"),
