        new( "PlanetTribhagaBala(PlanetNameplanetName,Timetime)"," Thribhagabala Mercury the Sun and Saturn get 60 shashtiamsas each during the lst 2nd and 3rd onethird positions of the day respectively. The Moon Venus and Mars govern the lst 2nd and 3rd onethird portion of the night respectively. Jupiter is always strong and gets 60 shashtiamsas of strength. ","{ 'PlanetTribhagaBala': '0'}"),
        new( "PlanetOchchaBala(PlanetNameplanetName,Timetime)"," Oochchabala The distance between the planets longitude and its debilitation point divided by 3 gives its exaltation strength or oochchabaJa. ","{ 'PlanetOchchaBala': '3.5489814814814817'}"),
        new( "IsDayBirth(Timetime)"," Determines if the input time is day during day used for birth times if day returns true ","{ 'IsDayBirth': 'True'}"),
        new( "PlanetPakshaBala(PlanetNameplanetName,Timetime)"," Pakshabala When the Moon is waxing take the distance from the Sun to the Moon and divide it by 3. The quotient is the Pakshabala. When the Moon is waning take the distance from the Moon to the Sun and divide it by 3 for assessing Pakshabala. Moon Jupiter Venus and Mercury are strong in Sukla Paksba and the others in Krishna Paksha. Note Mercury is benefic or malefic based on planets conjunct with it ","{ 'PlanetPakshaBala': '16.563148148148144'}"),
        new( "PlanetNathonnathaBala(PlanetNameplanetName,Timetime)"," Nathonnathabala Midnight to midday the Sun Jupiter and Venus gain strength proportionately till they get maximum at zenith. The other planets except Mercury. are gaining strength from midday to midnight proportionately. In the same way Mercury is always strong and gets 60 shashtiamsas. ","{ 'PlanetNathonnathaBala': '48.81666666666667'}"),
        new( "PlanetDigBala(PlanetNameplanetName,Timetime)"," Gets Dig Bala of a planet. Jupiter and Mercury are strong in Lagna Ascendant the Sun and Mars in the 10th Saturn in the 7th and the Moon and Venus in the 4th. The opposite houses are weak points. Divide the distance between the longitude of the planet and its depression point by 3. Quotient is the strength. ","{ 'PlanetDigBala': '55.84833333333333'}"),
        new( "HouseStrength(HouseNameinputHouse,Timetime)"," Bhava Bala.Bhava means house and Bala means strength. Bhava Bala is the potency or strength of the house or bhava or signification. We have already seen that there are 12 bhavas which comprehend all human events. Each bhava signifies or indicates certain events or functions. For instance the first bhava represents Thanu or body the appearance of the individual his complexion his disposition his stature etc. If it attains certain strength the native will enjoy the indications of the bhava fully otherwise he will not sufficiently enjoy them. The strength of a bhava is composed of three factors viz. 1 Bhavadhipathi Bala 2 Bhava Digbala 3 Bhava Drishti Bala. ","{ 'HouseStrength': '343.7767361111111'}"),
